import { Link } from 'react-router-dom'
import './nav.scss'

function nav() {
    return (
        <nav className='nav'>
            <ul className='navList'>
            <Link to="/">Accueil</Link>
            <Link to="/about">A propos</Link>
            </ul>
        </nav>
    )
}

export default nav
